import React from 'react';
import { Container, Grid, Paper, Typography, Button } from '@mui/material';
import AutonomousDrivingCard from '../components/AutonomousDrivingCard';
import WeatherAlertCard from '../components/WeatherAlertCard';
import ParkingUpdateCard from '../components/ParkingUpdateCard';
import SafetyInspectionCard from '../components/SafetyInspectionCard';
import InteractionHistory from '../components/InteractionHistory';
import useWebSocket from '../hooks/useWebSocket';

const HomePage = () => {
  const { messages, readyState, sendMessage, sendGenerateReport } = useWebSocket('ws://localhost:8000/ws');

  const handleSend = (task, data) => {
    sendMessage(task, data);
  };

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      <Grid container spacing={3}>
        {/* Interaction History */}
        <Grid item xs={12}>
          <Paper sx={{ p: 2, display: 'flex', flexDirection: 'column' }}>
            <Typography variant="h6" gutterBottom>
              Interaction History
            </Typography>
            <InteractionHistory interactions={messages} />
            <Button 
              variant="contained" 
              onClick={sendGenerateReport} 
              disabled={readyState !== 'open'}
              sx={{ mt: 2 }}
            >
              Generate City Analysis Report
            </Button>
          </Paper>
        </Grid>

        {/* Agent Interaction Cards */}
        <Grid item xs={12} md={6}>
          <AutonomousDrivingCard onSend={(data) => handleSend('autonomous_driving_task', data)} readyState={readyState} />
        </Grid>
        <Grid item xs={12} md={6}>
          <WeatherAlertCard onSend={(data) => handleSend('weather_alert_task', data)} readyState={readyState} />
        </Grid>
        <Grid item xs={12} md={6}>
          <ParkingUpdateCard onSend={(data) => handleSend('parking_update_task', data)} readyState={readyState} />
        </Grid>
        <Grid item xs={12} md={6}>
          <SafetyInspectionCard onSend={(data) => handleSend('safety_inspection_task', data)} readyState={readyState} />
        </Grid>
      </Grid>
    </Container>
  );
};

export default HomePage;
